void DAC_Out(uint32_t output){
	HAL_GPIO_WritePin(DAC_OUT_0_GPIO_Port, DAC_OUT_0_Pin, (uint8_t)(output & 0x1));
	HAL_GPIO_WritePin(DAC_OUT_1_GPIO_Port, DAC_OUT_1_Pin, (uint8_t)(output & 0x2));
	HAL_GPIO_WritePin(DAC_OUT_2_GPIO_Port, DAC_OUT_2_Pin, (uint8_t)(output & 0x4));
	HAL_GPIO_WritePin(DAC_OUT_3_GPIO_Port, DAC_OUT_3_Pin, (uint8_t)(output & 0x8));
}
void Timer_Start(void){
	HAL_TIM_Base_Start_IT(&htim1);
}
void Timer_Stop(void){
	HAL_TIM_Base_Stop_IT(&htim1);
}
void GameSound_Play(const char* p){
	if (0 == strcmp(p, "PLAYER_SHOOT")){
		music = Shoot;
		sampleIndex = 0;
		sampleCount = SHOOT_SIZE;
		Timer_Start();
	}
	if (0 == strcmp(p, "PLAYER_KILLED")){
		music = Explosion;
		sampleIndex = 0;
		sampleCount = EXPLOSION_SIZE;
		Timer_Start();
	}
	if (0 == strcmp(p, "ENEMY_KILLED")){
		music = InvaderKilled;
		sampleIndex = 0;
		sampleCount = INVADERKILLED_SIZE;
		Timer_Start();
	}
}
void HAL_TIM_PeriodElapsedCallback(TIM_HandleTypeDef *htim){
	if(&htim1 == htim){
		if (sampleCount > 0){
			DAC_Out(music[sampleIndex]);
			sampleCount--;
			sampleIndex++;
		}
		else {
			DAC_Out(0);
			Timer_Stop();
		}
	}
}
